import React from "react";
import $ from "jquery";

import "./Button.css";

const Button = props => {

function fade() {
    $(props.className).fadeIn().fadeOut();
}

    return (
        <button type="button" className={props.className} effect={props.effect}>
            {props.children}
        </button>
    );
};

export default Button;
